import React, { Component } from "react";

class Home extends Component {
  state = {};
  render() {
    return (
      <React.Fragment>
        <div className="two">
          <div className="logop">
            <a href="">
              <img class="max-width" src="images/logo.jpg" alt="logo" />
            </a>
          </div>
        </div>
      </React.Fragment>
    );
  }
}

export default Home;
